import React from "react";
import Card from './Cards';
import './index.css';
import Sdata from "./Sdata";


console.log(Sdata[0].sname);
function App(){
    return (
        <>
            <h1 className="heading_style">Netflix movies</h1>
            <Card

                imgsrc={Sdata[0].imgscr}
                title={Sdata[0].sname}
                link={Sdata[0].links}

            />
            <Card

                imgsrc={Sdata[1].imgscr}
                title={Sdata[2].sname}
                link={Sdata[2].links}
            />
            <Card

                imgsrc={Sdata[2].imgscr}
                title={Sdata[2].sname}
                link={Sdata[2].links}
            />
        </>
    )
}

export default App;
